import React from 'react'
import IndividualNews from './IndividualNews'
import { FormControl } from 'react-bootstrap'

const News = (props) => {

    let listItems = props.data?.hits.map((list, key) => {
        return <>
            <IndividualNews
            key = {list.key} 
            title = {list.title}
            points = {list.points}
            storyText = {list.story_text}
            commentText = {list.comment_text}
            numComment = {list.num_comments}
            />
        </>
    })

  return (<>
    <FormControl
          type="search"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
        />
    {listItems}
    </>
    )
}

export default News
